import React, { Component } from 'react'

export default class Navbar extends Component {
    render() {
        return (
            <header class="nav-home">
                <div class="nav-container" style={{transform: "translate(-91px, 25px)"}}>
                    <h1 class="nav-logo">
                        <a class="link" herf="">BuyBAY</a>
                    </h1>
                    <a class="link sign-up" herf="/login">
                        <button style={{transform: "translate(81rem, -1rem)"}}>Sign Up</button>
                    </a>
                </div>
            </header>
        )
    }
}
